import React, {ReactNode} from 'react';

class Divider extends React.Component {
  public render(): ReactNode {
    return (
      <div className="dropdown-divider col-lg-6 col-sm-6 mt-lg-5 mt-sm-5"></div>
    )
  }
}

export default Divider;
